import React, { useState } from 'react';
import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid'; // a plugin!

const Schedule = () => {
  const [currentView, setCurrentView] = useState('dayGridWeek');

  const handleViewChange = (view) => {
    setCurrentView(view);
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center' }}>
      <div style={{ width: '60%' }}>
        <div>
          <button onClick={() => handleViewChange('dayGridMonth')}>Month View</button>
          <button onClick={() => handleViewChange('dayGridWeek')}>Week View</button>
        </div>
        <FullCalendar
          plugins={[dayGridPlugin]}
          initialView={currentView}
          weekends={true}
          events={[
            { title: 'event 1', date: '2023-07-03' },
            { title: 'event 2', date: '2019-04-02' }
          ]}
        />
      </div>
    </div>
  );
};

export default Schedule;
